import logo from './logo.svg';
import './App.css';
import useCurrency from './hooks/useCurrency';

function App() {
  const data = useCurrency('usd')
  const options = Object.keys(data);
  console.log(options);
  return (

    <div className="App">
      <h1>CurrencyConverter</h1>
      <select>
        {options.map((item) => (
          <option>{item}</option>
        ))}
      </select>
    </div>
  );
}

export default App;
